import React from 'react'
import s from './AddForm.module.css'
import FormInputField from "./FormInputField/FormInputField";

const AddForm = (props) => {
    let id = React.createRef();
    let firstName = React.createRef();
    let lastName = React.createRef();
    let email = React.createRef();
    let phone = React.createRef();
    let streetAddress = React.createRef();
    let city = React.createRef();
    let state = React.createRef();
    let zip = React.createRef();
    let description = React.createRef();
    return (
        <div className={s.tableDiv}>
            <FormInputField className={s.id} lable={"id"} placeholder={"write id..."} linkRef={id} type={"number"}/>
            <FormInputField className={s.firstName} lable={"first name"} placeholder={"write first name..."} linkRef={firstName} type={"text"}/>
            <FormInputField className={s.firstName} lable={"last name"} placeholder={"write last name..."} linkRef={lastName} type={"text"}/>
            <FormInputField lable={"email"} placeholder={"write email..."} linkRef={email} type={"text"}/>
            <FormInputField lable={"phone"} placeholder={"write phone..."} linkRef={phone} type={"number"}/>
            <FormInputField lable={"street address"} placeholder={"write street..."} linkRef={streetAddress} type={"text"}/>
            <FormInputField lable={"city"} placeholder={"write city..."} linkRef={city} type={"text"}/>
            <FormInputField lable={"state"} placeholder={"write state..."} linkRef={state} type={"text"}/>
            <FormInputField lable={"zip"} placeholder={"write zip..."} linkRef={zip} type={"number"}/>
            <FormInputField lable={"description"} placeholder={"write description..."} linkRef={description} type={"textarea"}/>
        </div>
    )
}
export default AddForm
